import react, { Component } from 'react'
import JWTService from './JWTService';


class LogoutService extends Component
{
    constructor(props) {
        super(props)

        this.state = {
        }       
        
        this.logoutServices = this.logoutServices.bind(this)
       
    }
    componentDidMount() {      
        this.logoutServices();
        console.log(this.state)
        }

    logoutServices()
    {
        JWTService.logout();
    }

    render(){
        return(
            <div><h1>Log out success full
            </h1>
            <DesktopRouter />
            </div>
        );
    }
}

export default LogoutService;
